import React from "react";
import { useNavigate } from 'react-router-dom'

const Form = props => {
    let navigate = useNavigate();
	navigate('/user')
    (
    <form onSubmit = { props.getUser }>
        <input type="text" name="userName"></input>
        <button>Search</button>
    </form>
)
    }

export default Form
